; padding: 0; width: 100%; -premailer-cellpadding: 0; -premailer-cellspacing: 0; -premailer-width: 100%;">\n                    <!-- Email Body -->\n                    <tr>\n                        <td class="body" width="100%" cellpadding="0" cellspacing="0" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; background-color: #fff; border-bottom: 1px solid #edeff2; border-top: 1px solid #edeff2; margin: 0; padding: 0; width: 100%; -premailer-cellpadding: 0; -premailer-cellspacing: 0; -premailer-width: 100%;">\n                            <table class="inner-body" align="center" width="570" cellpadding="0" cellspacing="0" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; background-color: #fff; margin: 0 auto; padding: 0; width: 570px; -premailer-cellpadding: 0; -premailer-cellspacing: 0; -premailer-width: 570px;">\n                                <!-- Body content -->\n                                <tr>\n                                    <td class="content-cell" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; padding: 35px;">\n                                        <p style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; color: #74787e; font-size: 16px; line-height: 1.5em; margin-top: 0; text-align: left;">Hello user</p>\n<p style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; color: #74787e; font-size: 16px; line-height: 1.5em; margin-top: 0; text-align: left;">A user account has been created for you. Please use the following login and password to sign in:</p>\n<table class="panel break-all" width="100%" cellpadding="0" cellspacing="0" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; word-break: break-all; margin: 0 0 21px;">\n    <tr style="word-break: break-all;">\n        <td class="panel-content" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; word-break: break-all; background-color: #edeff2; padding: 16px;">\n            <table width="100%" cellpadding="0" cellspacing="0" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; word-break: break-all;">\n                <tr style="word-break: break-all;">\n                    <td class="panel-item" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; word-break: break-all; padding: 0;">\n                        <ul style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; line-height: 1.4; text-align: left; word-break: break-all;">\n<li style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; word-break: break-all;">Login: <code style="color: #74787e; font-size: 16px; line-height: 1.5em; word-break: break-all;">user3@mail.com</code>\n</li>\n<li style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; word-break: break-all;">Password: <code style="color: #74787e; font-size: 16px; line-height: 1.5em; word-break: break-all;">password</code>\n</li>\n</ul>\n                    </td>\n                </tr>\n            </table>\n        </td>\n    </tr>\n</table>\n<p style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; color: #74787e; font-size: 16px; line-height: 1.5em; margin-top: 0; text-align: left;">After signing in you should change your password as soon as possible.</p>\n                                    </td>\n                                </tr>\n                            </table>\n                        </td>\n                    </tr>\n                </table>\n            </td>\n        </tr>\n\n        <!-- Footer -->\n        <tr>\n    <td style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box;">\n        <table class="footer" align="center" width="570" cellpadding="0" cellspacing="0" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; margin: 0 auto; padding: 0; text-align: center; width: 570px; -premailer-cellpadding: 0; -premailer-cellspacing: 0; -premailer-width: 570px;">\n            <tr>\n                <td class="content-cell" align="center" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; padding: 35px;">\n                    <p style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; line-height: 1.5em; margin-top: 0; color: #aeaeae; font-size: 12px; text-align: center;"> 2020 October CMS. All rights reserved.</p>\n                </td>\n            </tr>\n        </table>\n    </td>\n</tr>\n    </table>\n\n</body>\n</html>\r\n\r\nContent-Type: text/plain; charset=utf-8\r\nContent-Transfer-Encoding: quoted-printable\r\n\r\nHello user\n\nA user account has been created for you. Please use the following login and password to sign in:\n\n- Login: `user3@mail.com`\n- Password: `password`\nAfter signing in you should change your password as soon as possible.', NULL, '2020-12-14 01:44:03', '2020-12-14 01:44:03'),
