ary" target="_blank" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; border-radius: 3px; box-shadow: 0 2px 3px rgba(0,0,0,0.16); color: #fff; display: inline-block; text-decoration: none; -webkit-text-size-adjust: none; background-color: #3498db; border-top: 10px solid #3498db; border-right: 18px solid #3498db; border-bottom: 10px solid #3498db; border-left: 18px solid #3498db;">\n                                            Sign in to admin area\n\n                                    </a>\n                                </td>\n                            </tr>\n                        </table>\n                    </td>\n                </tr>\n            </table>\n        </td>\n    </tr>\n</table>\n<p style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; color: #74787e; font-size: 16px; line-height: 1.5em; margin-top: 0; text-align: left;">After signing in you should change your password by clicking your name on the top right corner of the administration area.</p>\n\n                                        <!-- Subcopy -->\n                                        <table class="subcopy" width="100%" cellpadding="0" cellspacing="0" style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; border-top: 1px solid #edeff2; margin-top: 25px; padding-top: 25px;">\n    <tr>\n        <td style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box;">\n            <p style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box; color: #74787e; line-height: 1.5em; margin-top: 0; text-align: left; font-size: 12px;"><strong style="font-family: Avenir,Helvetica,sans-serif; box-sizing: border-box;">This is an automatic message. Please do not reply to it.</strong></p>\n        </td>\n    </tr>\n</table>                                    </td>\n                                </tr>\n                            </table>\n                        </td>\n                    </tr>\n                </table>\n            </td>\n        </tr>\n    </table>\n\n</body>\n</html>\r\n\r\nContent-Type: text/plain; charset=utf-8\r\nContent-Transfer-Encoding: quoted-printable\r\n\r\nHi pengawas 1 2\n\nA user account has been created for you on **October CMS**.\n\n- Login: `pengawas`\n- Password: `password`\nYou can use the following link to sign in:\n\nSign in to admin area <http://farhan.localhost/adm/backend>\nAfter signing in you should change your password by clicking your name on the top right corner of the administration area.\n\n\n---\nThis is an automatic message. Please do not reply to it.', NULL, '2020-12-18 08:22:23', '2020-12-18 08:22:23'),
